import React, { useEffect } from "react";
import YandexMapConstructor from "react-yandex-maps-constructor";

function MapComponent() {
  useEffect(() => {
    const script = document.createElement("script");
    script.src =
      "https://api-maps.yandex.ru/services/constructor/1.0/js/?um=constructor%3Ac46e5e336d5367fa5409fa8e1f528d3da54862723a35eda531bb62aabab498d5&amp;width=100%25&amp;height=713&amp;lang=ru_RU&amp;scroll=true";
    script.async = true;
    document.body.appendChild(script);

    return () => {
      document.body.removeChild(script);
    };
  }, []);
  return <div>MapComponent</div>;
}
export default MapComponent;
